import React from 'react';
import { Row, Col } from 'react-bootstrap';

const MypageModal = () => {

  return (

    <div className="apply-vacation-wrap">
      <div className="apply-vacation-inner">
        <div className="h-100 d-flex">
          <Col md={4}>
            <div>
              왼쪽
            </div>
          </Col>
          <Col md={8}>
            <div>
              오른쪽
            </div>
          </Col>
        </div>
      </div>
    </div>
  );
}

export default MypageModal;
